import classes from './Header.module.css';
import SearchBar from './SearchBar';

const Header = (props) => {
  const showArrowDesc = () => {
    console.log('asd');
  };

  return (
    <header className={classes.header}>
      <div className={classes.actions}>
        <div className={classes.arrows}>
          <div className={classes.arrow}>
            <div className={classes.arrowb} onMouseEnter={showArrowDesc}>
              {'<'}
            </div>
            <div className={classes.arrowDesc} onMouseEnter={showArrowDesc}>
              Go back
            </div>
          </div>
          <div className={classes.arrow}>
            <div className={classes.arrowb}>{'>'}</div>
            <div className={classes.arrowDesc}>Go forward</div>
          </div>
          {props.searchTerm && <SearchBar />}
        </div>
        <div className={classes.buttons}>
          <button className={classes.signup}>Sign up</button>
          <button className={classes.login}>Log in</button>
        </div>
      </div>
    </header>
  );
};

export default Header;
